import "./PhotoItem.css";

const PhotoItem = ({ photo }) => {
  return <div>
    <div className="photo-item">
        {photo.image && (
            <img src={`${uploads}/photos/${photo.image}`} alt={photo.title} />
        )}
        <h2>{photo.title}</h2>
    </div>

  </div>;
};

export default PhotoItem;
